public Query build(IQueryNode queryNode) {
    AnyQueryNode andNode = (AnyQueryNode) queryNode;
    BooleanQuery bQuery = new BooleanQuery();
    List<IQueryNode> children = andNode.getChildren();
    if (children != null) {
        for (IQueryNode child : children) {
            Object obj = child.getTag(QueryTreeBuilder.QUERY_TREE_BUILDER_TAGID);
            if (obj != null) {
                Query query = (Query) obj;
                try {
                    bQuery.add(query, BooleanClause.Occur.SHOULD);
                } catch (BooleanQuery.TooManyClausesException ex) {
                    throw new QueryNodeException(new Message(QueryParserMessages.EMPTY_MESSAGE), ex);
                }
            }
        }
    }
    bQuery.setMinimumNumberShouldMatch(andNode.getMinimumMatchingElements());
    return bQuery;
}

